import React from 'react';
import AppBar from '@mui/material/AppBar';

function Navbar() {
    const commonStyles = {
        height: 80,
        width: "100vw"
    }
    const navbarStyles = {
        position: "fixed",
        top: 0,
        left: 0,
        backgroundColor: "blue"
    }
    return (<>
        <AppBar>

        </AppBar>

        <div style={{ ...navbarStyles, ...commonStyles }}>
            HI this is the navbar
        </div>
        <div style={{ ...commonStyles }}>

        </div>
    </>);
}

export default Navbar;
